import './App.css';
import {
  BrowserRouter as Router,
  Route,
  Redirect,
  Switch,
} from 'react-router-dom';

import Players from '../src/players/pages/Players';

function App() {
  let routes;

  routes = (
    <Switch>
      <Route path="/" exact>
        <Players />
      </Route>
      <Redirect to="/" />
    </Switch>
  );

  return (
    <div className="App">
      <Players />
    </div>
  );
}

export default App;
